function T_PrComp = TPr_Swims(TPr_count, m, b)% T_PrComp = TPr_Swims(TPr_count, m, b);% Compute compensation temperature for pressure sensor;%   TPr_count = raw count from CTD (8 or 12-bit integer);%   m,b = slope,offset calibration coefficients%   T_PrComp = compensation temperatures [degC]; should be smoothed%       over 10s of seconds prior to use in pressure computation%       (SBE 9+ manual, pg 28, sec 3-8.4).%   DPW - apr/2002T_PrComp = TPr_count * m + b;